import logo from "./Assets/Logo_trans.png"  

function Header(){
    return <div className="header-content">
        <img src={logo} alt="Logo" />
        <br/>
        <h2>Hola</h2>
    </div>
}

export function TestingH2(){
    return <div className="testing-h2">
        <h2>This is a test</h2>
    </div>
}

export default Header;
